import React, { useState } from "react";
import {
  Typography,
  Button,
  Collapse,
  Box,
  Card,
  CardContent,
} from "@mui/material";

function CommitmentInfo() {
  const [open, setOpen] = useState(false);

  return (
    <Box sx={{ maxWidth: 500, margin: "2rem auto" }}>
      <Typography variant="h6" gutterBottom>
        헌신하는 정도란?
      </Typography>
      <Button
        variant="outlined"
        onClick={() => setOpen(!open)}
        sx={{ mb: 1 }}
      >
        {open ? "닫기" : "자세히 보기"}
      </Button>
      <Collapse in={open}>
        <Card variant="outlined">
          <CardContent>
            <Typography variant="body2">
              각 가치에 대해, 내가 실제로 삶 속에서 얼마나 실천하고 있는지를 떠올려보세요.
              가장 헌신하고 있다면 <strong>10</strong>, 거의 실천하지 못하고 있다면 <strong>1</strong>입니다.
              이 점수에는 정답이 없으며, 솔직한 현재의 모습을 돌아보는 데 목적이 있습니다.
            </Typography>
          </CardContent>
        </Card>
      </Collapse>
    </Box>
  );
}

export default CommitmentInfo;
